import React, { Component } from 'react';

class MainVideoInfo extends Component {

    convertTimestamp = () => {
        let ts = this.props.timestamp;
        return ts;
    }

    render () {
        return (
            <>
                <h1 className = "video-info h1-header">{this.props.title}</h1>
                <div className="video-info__chan-date">
                    <h2 className="h3-subheader">By {this.props.channel}</h2>
                    <h5 className="para">{this.props.timestamp}</h5>
                </div>
            </>
        );
    }
}
export default MainVideoInfo;
